import bisect
import math
from datetime import time
from typing import List


class Solution:
    def strongPasswordCheckerII(self, password: str) -> bool:
        n = len(password)
        if n < 8:
            return False
        lowercase, uppercase, number, special = False, False, False, False
        pre = ''
        for a in password:
            if a.islower():
                lowercase = True
            elif a.isupper():
                uppercase = True
            elif a.isdigit():
                number = True
            elif a in '!@#$%^&*()-+':
                special = True
            if a == pre:
                return False
            else:
                pre = a
        if lowercase and uppercase and number and special:
            return True
        return False

    def successfulPairs(self, spells: List[int], potions: List[int], success: int) -> List[int]:
        n = len(spells)
        m = len(potions)
        res = [0] * n
        potions.sort()
        for i, s in enumerate(spells):
            print(s, success // s, bisect.bisect_left(potions, success // s))
            res[i] = m - bisect.bisect_left(potions, math.ceil(success / s))
        return res

    def matchReplacement(self, s: str, sub: str, mappings: List[List[str]]) -> bool:
        mapping = {}
        for i in range(26):
            mapping[chr(ord('a') + i)] = str(chr(ord('a') + i))
        for i in range(26):
            mapping[chr(ord('A') + i)] = str(chr(ord('A') + i))
        for i in range(10):
            mapping[chr(ord('0') + i)] = str(chr(ord('0') + i))
        for o, l in mappings:
            mapping[o] += l
        for l in range(len(s) - len(sub) + 1):
            r = 0
            while l < len(s) and r < len(sub):
                if s[l] in mapping[sub[r]]:
                    r += 1
                else:
                    r = 0
                l += 1
                if r == len(sub):
                    return True
        return False

    def countSubarrays(self, nums: List[int], k: int) -> int:
        res = 0
        sums = [0] * (len(nums) + 1)
        for i in range(len(nums)):
            sums[i + 1] = sums[i] + nums[i]
        for i in range(len(nums)):
            for j in range(i + 1):
                if (sums[i + 1] - sums[j]) * (i - j + 1) < k:
                    res += 1
        return res


